import * as i0 from "@angular/core";
import * as i1 from "src/app/servicios/api/api.service";
import * as i2 from "@angular/router";
import * as i3 from "../../../plantillas/header/header.component";
import * as i4 from "@swimlane/ngx-charts";
export class GraficaComponent {
    constructor(api, router) {
        //Object.assign(this, { this.chartP });
        this.api = api;
        this.router = router;
        this.jugadores = [];
        this.especies = [];
        this.personajes = [];
        this.cantJugadores = 0;
        this.cantPersonajes = 0;
        this.cantEspecies = 0;
        this.titleChart = "Grafica";
        this.chartP = [];
        this.view = [700, 400];
        // options
        this.gradient = true;
        this.showLegend = true;
        this.showLabels = true;
        this.isDoughnut = false;
        this.legendPosition = 'below';
        this.colorScheme = {
            domain: ['#5AA454', '#A10A28', '#C7B42C', '#AAAAAA']
        };
    }
    ngOnInit() {
        this.getJugadores();
        this.getEspecies();
        this.getPersonajes();
        this.setValores();
        console.log(this.cantJugadores);
    }
    onSelect(data) {
        console.log('Item clicked', JSON.parse(JSON.stringify(data)));
    }
    onActivate(data) {
        console.log('Activate', JSON.parse(JSON.stringify(data)));
    }
    onDeactivate(data) {
        console.log('Deactivate', JSON.parse(JSON.stringify(data)));
    }
    async getJugadores() {
        let jugadores1 = [];
        await this.api.getAllJugadores()
            .toPromise().then((data) => {
            this.jugadores = data;
            this.cantJugadores = this.jugadores.length;
            this.chartP.push({ "name": "Jugadores", "value": this.cantJugadores });
            return this.jugadores;
        });
        this.chartP = [...this.chartP];
        console.log(this.cantJugadores);
    }
    async getEspecies() {
        let especies1 = [];
        await this.api.getAllEspecies()
            .toPromise().then((data) => {
            this.especies = data;
            this.cantEspecies = this.especies.length;
            this.chartP.push({ "name": "Especies", "value": this.cantEspecies });
        });
        this.chartP = [...this.chartP];
    }
    async getPersonajes() {
        let personajes1 = [];
        await this.api.getAllPersonajes()
            .toPromise().then((data) => {
            this.personajes = data;
            this.cantPersonajes = this.personajes.length;
            this.chartP.push({ "name": "Personajes", "value": this.cantPersonajes });
        });
        this.chartP = [...this.chartP];
    }
    async setValores() {
        this.chartP.push({
            "name": "Jugadores",
            "value": this.jugadores.length
        }, {
            "name": "Especies",
            "value": this.especies.length
        }, {
            "name": "Personajes",
            "value": this.personajes.length
        });
    }
}
